import InfoTooltip from "./InfoTooltip";
import React from "react";
import imageTrue from "../images/trueImage.svg"

function InfoTooltipFalse (props) {
  return(
    <InfoTooltip isOpen={props.isOpen} >
    <img src={imageTrue} />
    </InfoTooltip>
  )
}

export default InfoTooltipFalse;
